package com.example.admin.myapplicationtest.models;import io.objectbox.annotation.Entity;import io.objectbox.annotation.Id;import io.objectbox.relation.ToOne;@Entitypublic class Animal {    @Id(assignable = true)    public long id;    private String name;    private boolean flying;    private boolean swimming;    private boolean walking;    private ToOne<Zoo> zoo;    public ToOne<Zoo> getZoo() {        return zoo;    }    public void setZoo(ToOne<Zoo> zoo) {        this.zoo = zoo;    }    public long getId() {        return id;    }    public void setId(long id) {        this.id = id;    }    public String getName() {        return name;    }    public void setName(String name) {        this.name = name;    }    public boolean isFlying() {        return flying;    }    public void setFlying(boolean flying) {        this.flying = flying;    }    public boolean isSwimming() {        return swimming;    }    public void setSwimming(boolean swimming) {        this.swimming = swimming;    }    public boolean isWalking() {        return walking;    }    public void setWalking(boolean walking) {        this.walking = walking;    }}